import React from "react";

import Layout from "../components/Layout";
import Header from "../components/Header";
import Information from "../components/Information";

const Home = () => {
  const text =
    "            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Deleniti\n" +
    "            deserunt dicta distinctio dolor dolorem doloremque eaque earum\n" +
    "            eligendi eveniet ex facere fugiat fugit in incidunt, labore libero\n" +
    "            magnam maxime minus modi molestias nesciunt nisi odio odit quam quas\n" +
    "            qui quibusdam quo ratione rem rerum saepe temporibus vel velit.\n" +
    "            Sunt, ullam.";

  return (
    <React.Fragment>
      <Layout>
        <Header titleText={"L.H.M"} />
        <Information reverse={false} background={"/download.jpeg"} />
        <Information reverse={true} background={"/download.jpeg"} />
      </Layout>
    </React.Fragment>
  );
};

export default Home;
